import React from 'react';
import './_Banner.scss';
import gif1 from '../img/gato1.gif';
import gif2 from '../img/gato2.gif';
import earth from '../img/image-fondo.png';

export default function Banner() {
    return (
        <div className="banner">
            <div className="valueprop">
                <div className="valueprop-text">
                    <h1>Hello</h1>
                </div>
                <div className="valueprop-gif">
                    <img src={gif1} width="500"/>
                    <img src={gif2} width="500"/>
                </div>
            </div>
            <div className="earth">
                <img className="earth-img" src={earth}/>
            </div>
        </div>
    )
}
